        ion-toolbar {
          --background: var(--sio-right-menu-header-color);
        }
      }
      ion-content {
        --background: var(--sio-right-menu-content-color);
      }
      ion-footer {
        --background: var(--sio-right-menu-footer-color);
        ion-toolbar {
          --background: var(--sio-right-menu-footer-color);
          ion-item {
            --background: var(--sio-right-menu-footer-color);
          }
        }
      }
    }
  }
}

