import { Component, Input, OnInit, ViewChild } from '@angular/core';
import { IonToggle } from '@ionic/angular';
import { Select } from '@ngxs/store';
import { Observable } from 'rxjs';
import { Loggable, SioCoreLoggerService } from '../../services';
import { SioColorType } from '../../types';
import { SioCoreAppComponentState } from '../../store';

@Loggable()
@Component({
    selector: 'sio-darkmode-toggle',
    templateUrl: './darkmode-toggle.component.html',
    styleUrls: ['./darkmode-toggle.component.scss'],
    standalone: false
})
export class SioCoreDarkModeToggleComponent implements OnInit {
  @Input() public caption = 'L_DARKMODE';
  @Input() public style: 'default' | undefined = undefined;
  @Input() public color: SioColorType;
  @Input() public icon = 'sunny';

  public label = 'L_DARKMODE';

  @Select(SioCoreAppComponentState.darkmode) darkmode$!: Observable<boolean>; 

  @ViewChild('darkmode_toggle', { static: true }) ionToggle!: IonToggle;

  constructor(
    private sioCoreLoggerService: SioCoreLoggerService,
    public sioCoreAppComponentState: SioCoreAppComponentState
  ) {}

  ngOnInit(): void {
    this.darkmode$.subscribe((value) => {
      document.body.classList.toggle('dark', value);
      this.ionToggle.checked = value;
      this.label = this.caption + ((value)?'_ON':'_OFF');   
      this.icon = (value)?'moon':'sunny'; 
    });
  }
  // eslint-disable-next-line @typescript-eslint/no-explicit-any
  public onChange(event: any) {
    this.sioCoreLoggerService.debug('[SioCoreDarkModeToggleComponent][onChange] - Switch style');
    if (event.detail.checked) {
      this.sioCoreLoggerService.debug('[SioCoreDarkModeToggleComponent][onChange] - New Style is Dark Mode');
      this.sioCoreAppComponentState.setDark(true);
    } else {
      this.sioCoreLoggerService.debug('[SioCoreDarkModeToggleComponent][onChange] - New Style is Light Mode');
      this.sioCoreAppComponentState.setDark(false);
    }
  }
}

import { Component, EventEmitter, Input, OnInit, Output } from '@angular/core';
import { Loggable, SioCoreLoggerService } from '../../services/logger';
import {
  UntypedFormControl,
  UntypedFormGroup,
  Validators,
} from '@angular/forms';
import { SioCoreFormComponentState } from './store/form.state';
import { SioColorType } from '../../types';

@Loggable()
@Component({
    selector: 'sio-form',
    templateUrl: './form.component.html',
    standalone: false
})
export class SioCoreFormComponent implements OnInit {
  @Input() public cancel = false;
  @Input() public state!: SioCoreFormComponentState;
  @Input() public color: SioColorType = 'dark';

  @Output() send = new EventEmitter();

  public form!: UntypedFormGroup;

  constructor(private sioCoreLoggerService: SioCoreLoggerService) {
    this.sioCoreLoggerService.debug(`[SioCoreFormComponent][constructor]`);
  }

  ngOnInit(): void {
    this.sioCoreLoggerService.debug(`[SioCoreFormComponent][ngOnInit]`);
    // eslint-disable-next-line @typescript-eslint/no-explicit-any
    const group: any = {};
    if (this.state.layout) {
      // eslint-disable-next-line @typescript-eslint/no-explicit-any
      this.state.layout.forEach((field:any) => {
        this.sioCoreLoggerService.debug(`[SioCoreFormComponent][ngOnInit] add field`);
        const validator = [];
        if (field.required) validator.push(Validators.required);
        if (field.type === 'email') validator.push(Validators.email); //SioEmailValidator);
        if (field.type === 'tel')
          validator.push(Validators.pattern('^[0-9]+$'));
        group[field.name] = new UntypedFormControl(field.value, validator);
      });
      this.form = new UntypedFormGroup(group);
    }
  }

  public async onSubmit() {
    this.sioCoreLoggerService.info(
      '[SioCoreFormComponent][onSubmit] - form submitted'
    );
    this.send.emit();
  }
}

